import React from 'react';
import {Styles} from './formStyles';
//import {useForm} from 'react-hook-form';
//import saveData from './index';

export default function Form(){
    //const {register, handleSubmit}= useForm();
    return(
        <Styles><form>
            <h1>Επικοινωνήστε μαζί μας</h1>
            <label>Όνομα</label><input name="name"/>
            <label>Διεύθυνση</label><input name="address"/>
            <label>Ημερομηνία</label><input name="date"/>
            <label>Μήνυμα</label><input name="message"/>
            <input type= "submit"/>
        </form></Styles>
    );
}
